{
                        "FR0": {
                            "Type":"Soft",
                            "FR": 0,
                            "Description": "A clean, foul-free surface; red and/or black AF paint or bare metal surface."
                        },
                        "FR10": {
                            "Type":"Soft",
                            "FR":10,
                            "Description": "Light shades of red and green (incipient slime). Bare metal and painted surfaces are visible beneath the fouling."
                        },
                        "FR20": {
                            "Type":"Soft",
                            "FR":20,
                            "Description": "Slime as dark green patches with yellow or brown coloured areas (advanced slime). Bare metal and painted surfaces may be obscured by the fouling."
                        },
                        "FR30": {
                            "Type":"Soft",
                            "FR":30,
                            "Description": "Grass filaments up to 3 inches (76 mm) in length, projections up to 1⁄4 inch (6.4 mm) in height; or flat network of filaments, green, yellow, or brown in color, or soft non calcareous fouling such as sea cucumbers, sea grapes, or sea squirts projecting up to 1⁄4 inch (6.4 mm) in height. The fouling cannot be easily wiped off by hand."
                        },
                        "FR40": {
                            "Type":"Hard",
                            "FR":40,
                            "Description": "Calcareous fouling in the form of tube worms less than 1⁄4 inch (6.4 mm) in diameter or height."
                        },
                        "FR50": {
                            "Type":"Hard",
                            "FR":50,
                            "Description": "Calcareous fouling in the form of barnacles, less than 1⁄4 inch (6.4 mm) in diameter or height."
                        },
                        "FR60": {
                            "Type":"Hard",
                            "FR":60,
                            "Description": "Combination of tubeworms and barnacles less than 1⁄4 inch (6.4mm) in diameter or height."
                        },
                        "FR70": {
                            "Type":"Hard",
                            "FR":70,
                            "Description": "Combination of tubeworms and barnacles greater than 1⁄4 inch (6.4 mm) in diameter or height."
                        },
                        "FR80": {
                            "Type":"Hard",
                            "FR":80,
                            "Description": "Tubeworms closely packed together and growing upright away from surface. Barnacles growing one on top of another, 1⁄4 inch (6.4 mm) or less in height. Calcareous shells appear clean or white in color."
                        },
                        "FR90": {
                            "Type":"Hard",
                            "FR":90,
                            "Description": "Dense growth of tubeworms with barnacles, 1⁄4 inch (6.4 mm) or greater in height. Calcareous shells brown in color (oysters and mussels); or with slime or grass overlay."
                        },
                        "FR100": {
                            "Type":"Hard",
                            "FR":100,
                            "Description": "All forms of fouling present, soft and hard, particularly soft sedentary animals without calcareous covering (tunicates) growing over various forms of hard growth."
                        }
                    }

